import React from 'react';
import {Route, useNavigate} from 'react-router-dom';
import {isAuthenticated} from "../auth/isAuthenticated";


export const ProtectedRoute = ({ component: Component, ...rest }) => {
    const navigate = useNavigate();
    return (
        <Route
            {...rest}
            render={(props) =>
                isAuthenticated() ? (
                    <Component {...props} />
                ) : (
                    navigate("/login")
                )
            }
        />
    );
};
